func Test_numWays(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		/**
		示例 1：

		输入：s = "10101"
		输出：4
		解释：总共有 4 种方法将 s 分割成含有 '1' 数目相同的三个子字符串。
		"1|010|1"
		"1|01|01"
		"10|10|1"
		"10|1|01"
		示例 2：

		输入：s = "1001"
		输出：0
		示例 3：

		输入：s = "0000"
		输出：3
		解释：总共有 3 种分割 s 的方法。
		"0|0|00"
		"0|00|0"
		"00|0|0"
		示例 4：

		输入：s = "100100010100110"
		输出：12
		*/
		{
			name: "1",
			args: args{"10101"},
			want: 4,
		},
		{
			name: "1",
			args: args{"1001"},
			want: 0,
		},
		{
			name: "1",
			args: args{"0000"},
			want: 3,
		},
		{
			name: "1",
			args: args{"100100010100110"},
			want: 12,
		},
		{
			name: "1",
			args: args{""},
			want: 401097987,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := numWays(tt.args.s); got != tt.want {
				t.Errorf("numWays() = %v, want %v", got, tt.want)
			}
		})
	}
}
